/*
 *    markup example for $("#slider").easySlider();
 *
 *     <div id="slider">
 *        <ul>
 *            <li><img src="images/01.jpg" alt="" /></li>
 *            <li><img src="images/02.jpg" alt="" /></li>
 *            <li><img src="images/03.jpg" alt="" /></li>
 *            <li><img src="images/04.jpg" alt="" /></li>
 *            <li><img src="images/05.jpg" alt="" /></li>
 *        </ul>
 *    </div>
 *
 */

(function($) {

    $.fn.easySlider = function(options){

        // default configuration properties
        var defaults = {
            prevId:         'prevBtn',
            prevText:         '',
            nextId:         'nextBtn',
            nextText:         '',
            controlsShow:    true,
            hoverPause:     false,
            controlsBefore:    '',
            controlsAfter:    '',
            controlsFade:    true,
            firstId:         'firstBtn',
            firstText:         'First',
            firstShow:        false,
            lastId:         'lastBtn',
            lastText:         'Last',
            lastShow:        false,
            vertical:        false,
            speed:             800,
            auto:            false,
            pause:            3000,
            continuous:        false,
            numeric:         false,
            my_scroll_tabs:         false,
            numericId:         'controls'
        };

        var options = $.extend(defaults, options);

        this.each(function() {  
            var obj = $(this);
            var s = $("li", obj).length;
            var w = $("li", obj).width();
            var h = $("li", obj).height();
            var clickable = true;
            obj.width(w);
            obj.height(h);
            obj.css("overflow","hidden");
            var ts = s-1;
            var t = 0;
            $("ul", obj).css('width',s*w);

            if(options.continuous){
                $("ul", obj).prepend($("ul li:last-child", obj).clone().css("margin-left","-"+ w +"px"));
                $("ul", obj).append($("ul li:nth-child(2)", obj).clone());
                $("ul", obj).css('width',(s+1)*w);
            };

            if(!options.vertical) $("li", obj).css('float','left');

            if(options.controlsShow){
                var html = options.controlsBefore;
                if(options.numeric){
                    html += '<ol id="'+ options.numericId +'"></ol>';
                } else {
                    if(options.firstShow) html += '<span id="'+ options.firstId +'"><a href=\"javascript:void(0);\">'+ options.firstText +'</a></span>';
                    html += ' <span id="'+ options.prevId +'"><a href=\"javascript:void(0);\">'+ options.prevText +'</a></span>';
                    html += ' <span id="'+ options.nextId +'"><a href=\"javascript:void(0);\">'+ options.nextText +'</a></span>';
                    if(options.lastShow) html += ' <span id="'+ options.lastId +'"><a href=\"javascript:void(0);\">'+ options.lastText +'</a></span>';
                };

                html += options.controlsAfter;
                $(obj).after(html);
            };

            if(options.numeric){
                //rumen
                $("#"+options.firstId).click(function(){
                    var current = parseInt($("#"+options.numericId).find(".current").children().attr("rel"));
                    var max = parseInt($("#"+options.numericId).children(":last").children().attr("rel"));
                    current -= 1;
                    if(current < 0) {
                        current = max;
                    }
                    animate("prev",true);
                });
                $("#"+options.lastId).click(function(){
                    var current = parseInt($("#"+options.numericId).find(".current").children().attr("rel"));
                    var max = parseInt($("#"+options.numericId).children(":last").children().attr("rel"));
                    current += 1;
                    if(current > max) {
                        current = 0;
                    }
                    animate(current,true);
                });
                //end
                for(var i=0;i<s;i++){
                    $(document.createElement("li"))
                        .attr('id',options.numericId + (i+1))
                        .attr('class', 'pag-numbers')
                        .html('<a class="left" rel='+ i +' href=\"javascript:void(0);\">'+ (i+1) +'</a>')
                        .appendTo($("#"+ options.numericId))
                        .click(function(){
                            animate($("a",$(this)).attr('rel'),true);
                        });
                };
            } else {

                $("a","#"+options.nextId).click(function(){
                    animate("next",true);
                });
                $("a","#"+options.prevId).click(function(){
                    animate("prev",true);
                });
                $("a","#"+options.firstId).click(function(){
                    animate("first",true);
                });
                $("a","#"+options.lastId).click(function(){
                    animate("last",true);
                }); 
            };

            if(options.my_scroll_tabs) {
                $(".sidebar_news").bind("click",function(){
                    var tmpTabsEasy = null;
                    $.each($(".sidebar_news"),function(){
                        if($(this).hasClass("invisible")) {
                            tmpTabsEasy = $(this);
                        }
                    });
                    tmpTabsEasy.next().addClass("invisible");
                    tmpTabsEasy.removeClass("invisible");
                    $(this).addClass("invisible");
                    $(this).next().removeClass("invisible");
                    var goToTabs = parseInt($(this).attr("rel"));
                    animate(goToTabs,true);
                });
            }

            function setCurrent(i){
                i = parseInt(i)+1;
                $("li", "#" + options.numericId).removeClass("current");
                $("li#" + options.numericId + i).addClass("current"); 
            };

            function adjust(){
                if(t>ts) t=0;
                if(t<0) t=ts;
                if(!options.vertical) {
                    $("ul",obj).css("margin-left",(t*w*-1));
                } else {
                    $("ul",obj).css("margin-left",(t*h*-1));
                }
                clickable = true;
                if(options.numeric) setCurrent(t);
            };




            function animate(dir,clicked){

                  // We'll need this member variable to store a current hover state
                var mouseOver = false;

                // Handle mouse over of div
                obj.hover(function(){
                    mouseOver = true;
                }, function(){
                    mouseOver = false;
                });

                 // If the mouse is over the object, bail animation.
                if (options.hoverPause == true && mouseOver == true) {
                    return;
                }

                if (clickable){
                    clickable = false;
                    var ot = t;
                    switch(dir){
                        case "next":
                            t = (ot>=ts) ? (options.continuous ? t+1 : ts) : t+1;
                            break;
                        case "prev":
                            t = (t<=0) ? (options.continuous ? t-1 : 0) : t-1;
                            break;
                        case "first":
                            t = 0;
                            break;
                        case "last":
                            t = ts;
                            break;
                        default:
                            t = dir;
                            break;
                    };
                    var diff = Math.abs(ot-t);
                    var speed = diff*options.speed;
                    //rumen
                    if(obj.attr("id") == "slider_tabs_inner2") {
                        if(t == 3) {
                            $(".zodiac").css("height", "auto");
                            var the_height =  $(".zodiac").outerHeight(true);
                            $(".zodiac").css({"height":the_height});
                            $("#slider_tabs_inner2").css({"height":the_height});
                        }
                        else {
                            $(".zodiac").css({"height":h});
                            $("#slider_tabs_inner2").css({"height":h});
                        }
                    }

                    if(!options.vertical) {
                        p = (t*w*-1);
                        $("ul",obj).animate(
                            { marginLeft: p },
                            { queue:false, duration:speed, complete:adjust }
                        );
                    } else {
                        p = (t*h*-1);
                        $("ul",obj).animate(
                            { marginTop: p },
                            { queue:false, duration:speed, complete:adjust }
                        );
                    };

                    if(!options.continuous && options.controlsFade){
                        if(t==ts){
                            $("a","#"+options.nextId).hide();
                            $("a","#"+options.lastId).hide();
                        } else {
                            $("a","#"+options.nextId).show();
                            $("a","#"+options.lastId).show();
                        };
                        if(t==0){
                            $("a","#"+options.prevId).hide();
                            $("a","#"+options.firstId).hide();
                        } else {
                            $("a","#"+options.prevId).show();
                            $("a","#"+options.firstId).show();
                        };
                    };

                    if(clicked) clearTimeout(timeout);
                    if(options.auto && dir=="next" && !clicked){;
                        timeout = setTimeout(function(){
                            animate("next",false);
                        },diff*options.speed+options.pause);
                    };
                    

                };

            };



            // init
            var timeout;
            if(options.auto){;
                timeout = setTimeout(function(){
                    animate("next",false);
                },options.pause);
            };

            if(options.numeric) setCurrent(0);

            if(!options.continuous && options.controlsFade){
                $("a","#"+options.prevId).hide();
                $("a","#"+options.firstId).hide();
            };   
            


        });

    };

})(jQuery);


